import './App.css';
import { BrowserRouter as Router, Switch, Redirect, Route } from 'react-router-dom';
import { Box, Stack } from '@material-ui/core';
import { use100vh } from 'react-div-100vh';
import Nav from './components/Nav';
import wallpaper from "./images/wallpaper.png";
import Paths from "./components/paths";
import Page404 from "./components/Page404";
import AboutMe from "./components/AboutMe";

function App() {
  return (
    <Router>
      <Stack sx={{ backgroundImage: `url(${wallpaper})`, height: use100vh(), width:'100%', overflow:'hidden'}}>
        <Nav />
        <Switch>
        <Box sx={{ flexGrow: '1', overflowY: 'auto', overflowX: 'hidden', mx:'auto'}}>

          <Route exact path='/'>
            <Redirect exact  to={Paths.aboutMe} />
            </Route>

            <Route exact path={Paths.aboutMe}>
              <AboutMe />
            </Route>

            <Route exact path={Paths.education}>
            </Route>

            <Route exact path={Paths.projects}>
            </Route>

            <Route exact path={Paths.skills}>
            </Route>

            <Route exact path={Paths.courses}>
            </Route>

            <Route exact path={Paths.workHistory}>
            </Route>

            <Route exact path={Paths.resume}>
            </Route>

            <Route exact path={Paths.metadata}>
            </Route>

            <Route>
              {/* <Page404 /> */}
              <Redirect exact  to={Paths.aboutMe} />
            </Route>

          </Box>
          </Switch>
      </Stack>
    </Router>
  );
}

export default App;
